window.cockpit_po={"":{"plural-forms":e=>1!=e,language:"it"},"$0 error":[null,"Errore $0"],"$0 key changed":[null,"Chiave $0 modificata"],"A modern browser is required for security, reliability, and performance.":[null,"Un browser moderno è necessario per la sicurezza, l'affidabilità e le prestazioni."],"Accept key and log in":[null,"Accetta la chiave ed effettua l'accesso"],"Authentication failed":[null,"Autenticazione fallita"],"Authentication failed: Server closed connection":[null,"Autenticazione fallita: il server ha terminato la connessione"],Cancel:[null,"Annulla"],"Changed keys are often the result of an operating system reinstallation. However, an unexpected change may indicate a third-party attempt to intercept your connection.":[null,"La modifica delle chiavi sono di solito il risultato di una reinstallazione del sistema. Tuttavia, una modifica inaspettata può indicare un tentativo di intercettazione da parte di un soggetto terzo."],Cockpit:[null,"Cockpit"],"Cockpit authentication is configured incorrectly.":[null,"L'autenticazione di Cockpit non è configurata correttamente."],"Cockpit is a server manager that makes it easy to administer your Linux servers via a web browser. Jumping between the terminal and the web tool is no problem. A service started via Cockpit can be stopped via the terminal. Likewise, if an error occurs in the terminal, it can be seen in the Cockpit journal interface.":[null,"Cockpit è un gestore di server che rende facile amministrare i server Linux tramite un browser web. Cambiare tra il terminale e lo strumento web non è un problema. Un servizio avviato tramite Cockpit può essere interrotto tramite il terminale. Allo stesso modo, se si verifica un errore nel terminale, può essere visto nella sezione del registro di Cockpit."],"Cockpit is perfect for new sysadmins, allowing them to easily perform simple tasks such as storage administration, inspecting journals and starting and stopping services. You can monitor and administer several servers at the same time. Just add them with a single click and your machines will look after its buddies.":[null,"Cockpit è perfetto per i nuovi amministratori di sistema, consentendo loro di eseguire facilmente semplici operazioni come la gestione dell'archiviazione, l'ispezione del registro e l'avvio e l'arresto dei servizi. È possibile monitorare e amministrare più server allo stesso tempo. Basta aggiungerli con un solo clic e se ne prenderà subito cura."],"Connect to":[null,"Collegati a"],"Connect to:":[null,"Collegati a:"],"Download a new browser for free":[null,"Scarica gratuitamente un nuovo browser"],'If the fingerprint matches, click "Accept key and log in". Otherwise, do not log in and contact your administrator.':[null,"Se l'impronta digitale coincide, clicca \"Accetta la chiave e autentica\". Altrimenti, non autenticare e contatta l'amministratore."],"Internal error: Invalid challenge header":[null,"Errore interno: challenge header non valido"],"Log in":[null,"Accedi"],"Log in with your server user account.":[null,"Accedi con il tuo account utente del server."],Login:[null,"Accesso"],"Login again":[null,"Effettua di nuovo il login"],"Logout successful":[null,"Logout riuscito"],"New host":[null,"Nuovo host"],'Once Cockpit is installed, enable it with "systemctl enable --now cockpit.socket".':[null,'Una volta installato Cockpit, abilitarlo con "systemctl enable --now cockpit.socket".'],"Or use a bundled browser":[null,"Oppure utilizzare un browser in bundle"],"Other options":[null,"Altre opzioni"],Password:[null,"Password"],"Permission denied":[null,"Permesso negato"],"Please enable JavaScript to use the Web Console.":[null,"Abilita Javascript per usare Web Console"],"Please specify the host to connect to":[null,"Specifica l'host a cui connettersi"],"Refusing to connect. Host is unknown":[null,"Rifiuto di connessione. L'host è sconosciuto"],"Refusing to connect. Hostkey does not match":[null,"Rifiuto di connessione. Il tasto Hostkey non corrisponde"],"Refusing to connect. Hostkey is unknown":[null,"Rifiuto di connessione. La chiave host è sconosciuta"],Server:[null,"Server"],"The resulting fingerprint is fine to share via public methods, including email.":[null,"L'impronta digitale risultante è idonea per la condivisione pubblica, email inclusa."],"The server refused to authenticate '$0' using password authentication, and no other supported authentication methods are available.":[null,"Il server ha rifiutato di autenticare '$0' utilizzando l'autenticazione con password, e non sono disponibili altri metodi di autenticazione supportati."],"The web browser configuration prevents Cockpit from running (inaccessible $0)":[null,"La configurazione del browser web impedisce l'esecuzione di Cockpit ($0 inaccessibile)"],"This web browser is too old to run the Web Console (missing $0)":[null,"Questo browser web è troppo vecchio per eseguire Web Console ($0 mancante)"],"To ensure that your connection is not intercepted by a malicious third-party, please verify the host key fingerprint:":[null,"Per assicurare che la connessione non sia intercettata da un soggetto terzo malelvolo, verifica l'impronta digitale dell'host:"],"To verify a fingerprint, run the following on $0 while physically sitting at the machine or through a trusted network:":[null,"Per verificare un'impronta digitale, esegui su $0 mentre sei fisicamente di fronte alla macchina o attraverso una rete fidata:"],"Try again":[null,"Riprova"],"Unable to connect to that address":[null,"Impossibile connettersi a quell'indirizzo"],"User name":[null,"Nome utente"],"User name cannot be empty":[null,"Il nome utente non può essere vuoto"],"Validating authentication token":[null,"Convalida del token di autenticazione"],"Web Console for Linux servers":[null,"Web Console per server Linux"],"Wrong user name or password":[null,"Nome utente o password errata"],"You are connecting to $0 for the first time.":[null,"Collegamento a $0 per la prima volta"]};